  false,\n\t\"url\": null,\n\t\"notes\": \"The Mingo National Wildlife Refuge Habitat
  Management Plan provides a long-term vision and specific guidance on managing habitats
  for the resources of concern at Mingo, to facilitate continuity in management programs.
  Refuge background, resources of concern, and habitat management goals and objectives
  are discussed. Management strategies and prescriptions then identify how and the
  specific means by which management and monitoring strategies will be implemented.
